import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import map from "./assets/map.png";

export default function Visualizer({ path = [], distance = 0, algorithm = "" }) {
  const [dimensions, setDimensions] = useState({
    width: window.innerWidth,
    height: window.innerHeight,
  });

  useEffect(() => {
    const handleResize = () => {
      setDimensions({ width: window.innerWidth, height: window.innerHeight });
    };
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const { width, height } = dimensions;

  const cityCoords = {
  A: { x: 8, y: 75 },
  B: { x: 18, y: 60 },
  C: { x: 20, y: 85 },
  D: { x: 28, y: 45 },
  E: { x: 35, y: 60 },
  F: { x: 30, y: 88 },
  G: { x: 40, y: 80 },
  H: { x: 45, y: 35 },
  I: { x: 50, y: 55 },
  J: { x: 55, y: 65 },
  K: { x: 58, y: 90 },
  L: { x: 68, y: 80 },
  M: { x: 65, y: 25 },
  N: { x: 72, y: 45 },
  O: { x: 80, y: 60 },
  P: { x: 85, y: 80 },
  Q: { x: 88, y: 40 },
};

  const scaledCoords = {};
  for (const city in cityCoords) {
    scaledCoords[city] = {
      x: (cityCoords[city].x / 100) * width,
      y: (cityCoords[city].y / 100) * height,
    };
  }

  const segments = [];
  for (let i = 0; i < path.length - 1; i++) {
    const start = scaledCoords[path[i]];
    const end = scaledCoords[path[i + 1]];
    if (start && end) segments.push([start, end]);
  }

  return (
    <div
      className="relative w-full h-screen overflow-hidden"
      style={{
        backgroundImage: `url(${map})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
      }}
    >
      {/* City markers */}
      {Object.entries(scaledCoords).map(([city, pos]) => (
        <div
          key={city}
          className="absolute w-6 h-6 bg-blue-400 rounded-full flex items-center justify-center text-sm text-white font-semibold shadow-md shadow-blue-500"
          style={{
            left: pos.x,
            top: pos.y,
            transform: "translate(-50%, -50%)",
          }}
        >
          {city}
        </div>
      ))}

      {/* Route lines */}
      {segments.map(([start, end], idx) => {
        const dx = end.x - start.x;
        const dy = end.y - start.y;
        const lineLength = Math.hypot(dx, dy);
        const angle = Math.atan2(dy, dx);
        return (
          <motion.div
            key={idx}
            className="absolute h-[3px] bg-yellow-400 shadow-[0_0_20px_#facc15]"
            initial={{ scaleX: 0 }}
            animate={{ scaleX: 1 }}
            transition={{ duration: 0.8, delay: idx * 0.3 }}
            style={{
              left: start.x,
              top: start.y,
              width: lineLength,
              transformOrigin: "0% 50%",
              rotate: `${angle}rad`,
            }}
          />
        );
      })}

      {/* ‚úàÔ∏è Smooth airplane animation */}
     {segments.length > 0 && (
  <motion.div
    className="absolute text-4xl"
    initial={{
      x: scaledCoords[path[0]].x,
      y: scaledCoords[path[0]].y,
    }}
    animate={{
      x: path.map((city) => scaledCoords[city].x),
      y: path.map((city) => scaledCoords[city].y),
    }}
    transition={{
      duration: Math.max(6, path.length * 1.8),
      ease: "easeInOut",
      times: path.map((_, i) => i / (path.length - 1)),
    }}
    style={{
      transform: "translate(-50%, -50%)",
      color: "red",
      textShadow: "0 0 15px red",
    }}
  >
    ‚úàÔ∏è
  </motion.div>
)}


      {/* Route summary box */}
      {path.length > 1 && (
        <div className="absolute bottom-6 left-6 bg-slate-900/70 backdrop-blur-md p-5 rounded-xl shadow-xl border border-slate-700 text-white text-sm">
          <p className="text-lg font-semibold text-yellow-300 mb-1">üó∫Ô∏è Route Summary</p>
          <p><span className="text-blue-400">Algorithm:</span> {algorithm.toUpperCase()}</p>
          <p><span className="text-blue-400">Path:</span> {path.join(" ‚Üí ")}</p>
          <p><span className="text-blue-400">Total Distance:</span> {distance} km</p>
        </div>
      )}
    </div>
  );
}
